import React, { useState, useEffect } from 'react';
const Portfolio = () => {
    const [prices,setPrices] = useState([]);
    // const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });
    useEffect(() => {
        let url = 'https://www.alphavantage.co/query?';
        let func = 'function=TIME_SERIES_INTRADAY';
        let symbol = 'symbol=MSFT';
        let apiKey = `apikey=${process.env.REACT_APP_ALPHA_VANTAGE_API_KEY}`;
        let interval = '15min';
        console.log(`${url}${func}&${symbol}&${interval}&${apiKey}`)
        fetch(`${url}${func}&${symbol}&${interval}&${apiKey}`)
        .then(json => {
            console.log(Object.entries(json))
            return Object.entries(json);
        })
        .then(data => {
            setPrices(data)
            console.log('hi');
        });
    },[])

    // const getValues = () => {
    //     let microsoft
    //         microsoft = data['Time Series (1min)'];
    //         // console.log(Object.keys(data))
    //     });
    //     return microsoft;
    // }

    return (
        <div>
            {prices}
        </div>
    );
}
 
export default Portfolio;
